export default function PlanetsList({ data }) {
	console.log(data)

	if (data.name === 'Yavin IV') {
		data.name = 'Yavin-IV'
	}

	let items = []
	data.map((i) => {
		items.push(
			<h3 className='nav-name' key={i.name}>{i.name.toLowerCase()}</h3>
		)
	})

	return(
		<div className='nav-group'>
			{items}
			{/*<h1>lhawkleurhlser</h1>*/}
		</div>
	)
}
